import { createRouter, createWebHashHistory } from "vue-router";
import auth_Page from "@/components/Auth.vue"
import analitic_Page from "@/components/Analitic.vue"

export const router = createRouter({
          history: createWebHashHistory(),
          routes: [
                    {
                              path: '/auth',
                              component: auth_Page
                    },
                    {
                              path: '/analitic',
                              component: analitic_Page
                    },
          ]
})
